import {
    Stack
} from "@mui/material"
import React from "react"

import { colors } from "../../utils/CustomTheme"

const Header = () => {
    return (
        <Stack
            justifyContent="center"
            alignItems="center"
            sx={{ height: 70, marginBottom: 30, borderBottom: `5px dashed ${colors.saffron}` }}
        >
            HEADER
        </Stack>
    )
}
export default Header
